            AngyWordsStyleKit.drawCanvasBabbelFigure()

        Cache.imageOfCanvasBabbelFigure = UIGraphicsGetImageFromCurrentImageContext()!
        UIGraphicsEndImageContext()

        return Cache.imageOfCanvasBabbelFigure!
    }

